column8:
ジムニーJA系のトランスファーギアセット。<br>
耐摩耗性で強度のあるSCM435を高精度で焼き入れして製造。<br>
<br>
■ギア比　6.5：1■<br>
ローレンジギアは驚異の6.5:1というギア比を誇るもので、国内最低です。<br>
ハイレンジも1.7:1と大径タイヤ装着車の普段乗りにうれしいギア比設定になっています。<br>
※注意:組み付け時にケースを若干削らなければならない車両もありますので、詳しくはお問い合わせください。<br>
取り付けに必要なベアリング類、強化センターシャフト、ガスケット付属のお得なギアセットです。<br>
<br>
※競技用部品です。<br>
<br>
<br>
※※JA11クローラーギア組み込みオプションについて※※<br>
トランスファーを送っていただき、クローラーギアを組み付けしてお送りするオプションが別途ございます。<br>
商品をご注文の際にオプションを同時にご注文下さい。
<br>
<br>
※1年間保証について※ 
通常使用した状態で故障した場合には、ご購入から1年以内に1度だけ(1year 1time)<br>
商品または故障部品を交換いたします。<br>
なお、商品交換の際に生じる交通費・送料などはお客様のご負担となります。<br>
また、商品の交換の際に生じる工賃等は保証の対象外です。<br>
付属の保証書は再発行できませんので、保証規定をお読みになり、ご購入明細書とともに大切に保管して下さい。<table width="800" cellspacing="0" cellpadding="5" border="0">
