JA11クローラーギア組み込みオプション。<br>
トランスファーを送っていただき、クローラーギアを当社にて組み付け後、お送りいたします。<br>
JA11クローラーギアをご購入の際に同時にご注文下さい。<br>
<br>
■トランスファーをお送りいただく際の送料はお客様のほうで元払いにてお支払お願いします。<br>
■作業日程・納期は、当社の作業状況によって異なりますので必ず事前にお問い合わせください。<br>
■クローラーギア購入時の同時購入に限ります。<br>
その際、送料は計算されませんので<br>
