ホーシング逆付け等の車高が高いリーフ車にありがちな<br>
走行不安定、ハンドルの切れ角不足を解消する画期的なパーツ。<br>
キットには鍛造8620製のブラケット、中実のヘビーデューティ仕様のロッド、<br>
ランドクルーザー80のタイロッドエンド、
さらに取り付けに必要なリーマー、パーツが全て入っています。<br>
JB31用。<br>
